        },
        "channelTitle": "Science ABC",
        "tags": [
          "Time Dilation",
          "what is time dilation",
          "einstein theory of relativity explained",
          "time dilation explained",
          "how time dilation works",
          "Theory of Relativity",
          "special relativity time dilation",
          "time dilation experiment",
          "Special relativity explained",
          "time dilation and length contraction",
          "special relativity",
          "general relativity vs special relativity theory",
          "space time explained",
          "how time dilation causes gravity",
          "Einstein",
          "General Relativity",
          "physics",
          "science",
          "space time"
        ],
        "categoryId": "28",
        "liveBroadcastContent": "none",
        "defaultLanguage": "en",
        "localized": {
          "title": "Dilatation du temps - La théorie de la relativité d'Einstein expliquée !",
          "description": "La dilatation du temps et la théorie de la relativité d'Einstein vont de pair. Albert Einstein est le physicien le plus populaire, car il a formulé la théorie de la relativité, qui a donné la formule d'équivalence de masse énergétique et est directement liée à la dilatation du temps. Mais qu'est-ce que la dilatation du temps ? La dilatation du temps et l'espace-temps sont interdépendants. Einstein a fait l'une des contributions les plus importantes à la physique et a expliqué le concept d'espace-temps. Une explication simple de l'espace-temps est qu'il s'agit d'un modèle mathématique qui fusionne les trois dimensions de l'espace et la dimension unique du temps en un seul continuum à quatre dimensions. Mais il est très important de comprendre que la théorie générale de la relativité et la théorie restreinte de la relativité sont différentes. Dans cette courte vidéo animée, nous donnons une explication simple de la dilatation du temps et de la théorie de la relativité d'Einstein et expliquons également comment le temps ralentit dans un véhicule en mouvement !\n\n\n #science #animation #timedilation #TheoryofRelativity\n\n Références:\n\n https://faraday.physics.utoronto.ca/PVB/Harrison/GenRel/TimeDilation.html\n http://newt.phys.unsw.edu.au/einsteinlight/jw/module4_time_dilation.htm\n https://web.pa.msu.edu/courses/2000fall/PHY232/lectures/relativity/dilation.html\n http://www.physics.nyu.edu/~ts2/Animation/Time_dilation.html\n\n\n ABONNEZ-VOUS pour recevoir plus de vidéos scientifiques de ce type !\n https://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\n Suivez-nous sur Twitter!\n https://twitter.com/abc_science\n\n Suis nous sur Facebook!\n https://facebook.com/sciabc\n\n Suivez notre site Web!\n https://www.scienceabc.com"
        },
